      SELECT DISTINCT - - cor0.col1 + 71 + cor0.col1 * cor1.col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab1

